import React, { Component } from 'react';
import GoogleMapReact from 'google-map-react';//todo ishlamasa o`chirib tashsa
import MapMarker from './MapMarker';

class MapBlock extends Component {
    constructor(props) {
        super(props);
        this.state = {
            clickedMarker: null
        };
    }

    static defaultProps = {
        center: {
            lat: 50.6304916,
            lng: 3.0526526
        },
        zoom: 14
    };

    render() {
        const meals=[{latitude:41.31744719983237,longitude:69.25418154497156, id: 10}]
        return (
            // Important! Always set the container height explicitly
            <div style={{flex: '0 0 35rem', height: '100vh', position: 'sticky', top: '0'}}>
                <div className=""
                     style={{height: '100%', width: '100%', position: 'absolute', top: '0px', left: '0px'}}>
                    <GoogleMapReact
                        bootstrapURLKeys={{key: ""}}
                        // defaultCenter={center}
                        // defaultZoom={zoom}
                    >
                        {meals.map(m => {
                            return (
                                <MapMarker
                                    lat={m.latitude}
                                    lng={m.longitude}
                                    key={m.id}
                                />
                            )
                        })}
                    </GoogleMapReact>
                </div>
            </div>
        );
    }
}

export default MapBlock;
